import React from 'react';
import {Router} from 'react-router';
import {Route} from 'react-router-dom'
import './App.css';
import Page from './pages/User/Page';
import Header from './components/Header/Header';

function App() {
  return (
    <Router>
      <Header/>
      <Route path = "/" component={Page}/>
    </Router>
  );
}

export default App;
